import React from "react";
import ReactDOM from 'react-dom';
import Button from "./Button";

function Btn (){
    return (
        <div className="Btn">
            <Button/>
        </div>
    )
}



document.addEventListener('DOMContentLoaded', () => {
    ReactDOM.render(
      <Btn/>,
      document.getElementById('Btn')
    )
    })
